const Users = (props) => {
  console.log(props);
  return (
    <div>
      <ul className="list-group">
        {props.users.map((user) => {
          return (
            <li className="list-group-item">
              <h5>{user.name}</h5>
            </li>
          );
        })}
      </ul>
    </div>
  );
};

export default Users;
